import * as React from 'react';
import './Home.css'
import {styled} from '@mui/material/styles';
import Card from '@mui/material/Card';
import CardHeader from '@mui/material/CardHeader';
import CardMedia from '@mui/material/CardMedia';
import CardContent from '@mui/material/CardContent';
import CardActions from '@mui/material/CardActions';
//import Grid from '@mui/material/Grid';
import Collapse from '@mui/material/Collapse';
// import Avatar from '@mui/material/Avatar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
// import {red} from '@mui/material/colors';
// import FavoriteIcon from '@mui/icons-material/Favorite';
// import ShareIcon from '@mui/icons-material/Share';
import PlayArrowIcon from '@mui/icons-material/PlayArrow';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
// import MoreVertIcon from '@mui/icons-material/MoreVert';
import BlockchainImg from './components/Blockchain/BlockchainImg.jpg';
import QuantumComImg from './components/QuantumCom/QuantumComImg.jpg';
import PythonImg from './components/Python/PythonImg.jpg';
import PlayP6English from './components/P6English/PlayP6English';
// import {Link} from 'react-router-dom';

const ExpandMore = styled((props) => {
    const {expand, ...other} = props;
    return <IconButton {...other} />;
})(({theme, expand}) => ({
    transform: !expand ? 'rotate(0deg)' : 'rotate(180deg)',
    marginLeft: 'auto',
    transition: theme.transitions.create('transform', {
        duration: theme.transitions.duration.shortest,
    }),
}));

function Home() {
    const [expanded, setExpanded] = React.useState(false);

    const handleExpandClick = () => {
        setExpanded(!expanded);
    };

    return (
        <div className="title">
            <h4> Domanda - Play and Learn </h4>
            <br></br>
            <div className="wrapper">
                <Card sx={{maxWidth: 345}}>
                    <CardHeader
                        // avatar={
                        //     <Avatar sx={{ bgcolor: red[500] }} aria-label="recipe">
                        //         R
                        //     </Avatar>
                        // }
                        // action={
                        //     <IconButton aria-label="settings">
                        //         <MoreVertIcon />
                        //     </IconButton>
                        // }
                        title="Blockchain Technology"
                        // subheader="25 January 2023"
                    />
                    <CardMedia
                        component="img"
                        height="194"
                        image={BlockchainImg}
                        alt="Blockchain Technology"
                    />
                    <CardContent>
                        <Typography variant="body2" color="text.secondary">
                            Blockchain technology is a decentralized and distributed digital ledger that records transactions across a network of computers.
                            It uses cryptography to ensure the integrity and immutability of the data stored on the blockchain, making it secure and tamper-proof.
                        </Typography>
                    </CardContent>
                    <CardActions disableSpacing>
                        {/*<IconButton aria-label="add to favorites">*/}
                        {/*    <FavoriteIcon />*/}
                        {/*</IconButton>*/}
                        {/*<IconButton aria-label="share">*/}
                        {/*    <ShareIcon />*/}
                        {/*</IconButton>*/}
                        <IconButton aria-label="play">
                            {/* <a href="/playBlockchainCon"> */}
                                <a href="playBlockchainFC">
                                <PlayArrowIcon/>
                            </a>
                        </IconButton>

                        <ExpandMore
                            expand={expanded}
                            onClick={handleExpandClick}
                            aria-expanded={expanded}
                            aria-label="show more"
                        >
                            <ExpandMoreIcon/>
                        </ExpandMore>
                    </CardActions>
                    <Collapse in={expanded} timeout="auto" unmountOnExit>
                        <CardContent>
                            <Typography paragraph>Details:</Typography>
                            <Typography paragraph>
                                10 Questions on Blockchain Technology.
                                Published on 1 February 2023.
                            </Typography>
                        </CardContent>
                    </Collapse>
                </Card>


                <Card sx={{maxWidth: 345}}>
                    <CardHeader
                        // avatar={
                        //     <Avatar sx={{ bgcolor: red[500] }} aria-label="recipe">
                        //         R
                        //     </Avatar>
                        // }
                        // action={
                        //     <IconButton aria-label="settings">
                        //         <MoreVertIcon />
                        //     </IconButton>
                        // }
                        title="Quantum Computing"
                        // subheader="25 January 2023"
                    />
                    <CardMedia
                        component="img"
                        height="194"
                        image={QuantumComImg}
                        alt="Quantum Computing"
                    />
                    <CardContent>
                        <Typography variant="body2" color="text.secondary">
                        Quantum computing is a type of computing that uses the properties of quantum mechanics to perform operations on data. 
                        It has the potential to solve certain problems much faster than classical computing and could have applications in fields 
                        such as cryptography, chemistry, and artificial intelligence.
                        </Typography>
                    </CardContent>
                    <CardActions disableSpacing>
                        {/*<IconButton aria-label="add to favorites">*/}
                        {/*    <FavoriteIcon />*/}
                        {/*</IconButton>*/}
                        {/*<IconButton aria-label="share">*/}
                        {/*    <ShareIcon />*/}
                        {/*</IconButton>*/}
                        <IconButton aria-label="play">
                            <a href="/">
                                <PlayArrowIcon/>
                            </a>
                        </IconButton>

                        <ExpandMore
                            expand={expanded}
                            onClick={handleExpandClick}
                            aria-expanded={expanded}
                            aria-label="show more"
                        >
                            <ExpandMoreIcon/>
                        </ExpandMore>
                    </CardActions>
                    <Collapse in={expanded} timeout="auto" unmountOnExit>
                        <CardContent>
                            <Typography paragraph>Details:</Typography>
                            <Typography paragraph>
                                10 Questions on Quantum Computing.
                                Published on 1 February 2023.
                            </Typography>
                        </CardContent>
                    </Collapse>
                </Card>

                <Card sx={{maxWidth: 345}}>
                    <CardHeader
                        // avatar={
                        //     <Avatar sx={{ bgcolor: red[500] }} aria-label="recipe">
                        //         R
                        //     </Avatar>
                        // }
                        // action={
                        //     <IconButton aria-label="settings">
                        //         <MoreVertIcon />
                        //     </IconButton>
                        // }
                        title="P6English"
                        // subheader="25 January 2023"
                    />
                    <CardMedia
                        component="img"
                        height="194"
                        image={BlockchainImg}
                        alt="P6English"
                    />
                    <CardContent>
                        <Typography variant="body2" color="text.secondary">
                        P6 English for PSLE practice.
                        </Typography>
                    </CardContent>
                    <CardActions disableSpacing>
                        {/*<IconButton aria-label="add to favorites">*/}
                        {/*    <FavoriteIcon />*/}
                        {/*</IconButton>*/}
                        {/*<IconButton aria-label="share">*/}
                        {/*    <ShareIcon />*/}
                        {/*</IconButton>*/}
                        <IconButton aria-label="play">
                            <a href="/p6English">
                                <PlayArrowIcon/>
                            </a>
                        </IconButton>

                        <ExpandMore
                            expand={expanded}
                            onClick={handleExpandClick}
                            aria-expanded={expanded}
                            aria-label="show more"
                        >
                            <ExpandMoreIcon/>
                        </ExpandMore>
                    </CardActions>
                    <Collapse in={expanded} timeout="auto" unmountOnExit>
                        <CardContent>
                            <Typography paragraph>Details:</Typography>
                            <Typography paragraph>
                                Questions on P6 English.
                                Published on 1 February 2023.
                            </Typography>
                        </CardContent>
                    </Collapse>
                </Card>

            </div>
        </div>
    )

}

export default Home;
